ed all three of those plants  and bought a whole lot more, growing into a total of more than 100 succulents!\n\nAlong the way, I made a lot of mistakes. Ive accidentally drowned, burned, frozen, and starved more succulents than I care to remember. Thats why I created this site: so you can save your succulents from the same mistakes I did with mine  or help them recover, if necessary.\n\nBut for every succulent Ive unintentionally hurt, Ive kept hundreds more alive and thriving  and I know you can do it, too!\n\nBe sure to subscribe to see new videos with succulent tips and tricks each week!\n\nhttps://www.succulentsandsunshine.com/subscribe"},"callToAction":{"simpleText":"VISIT CHANNEL"},"dismiss":{"simpleText":"CANCEL"},"endpoint":{"clickTrackingParams":"CFIQ-N4BGAAiEwjklJj0wd3wAhVmxRYJHbXkAVUyDGl2LWVuZHNjcmVlbkiSkLup79TAqM4B","commandMetadata":{"webCommandMetadata":{"url":"/channel/UCu8PPJ8s8-WGL0BBliB4duQ","webPageType":"WEB_PAGE_TYPE_CHANNEL","rootVe":3611,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"UCu8PPJ8s8-WGL0BBliB4duQ"}},"hovercardButton":{"subscribeButtonRenderer":{"buttonText":{"runs":[{"text":"SUBSCRIBE"}]},"subscribed":false,"enabled":true,"type":"FREE","channelId":"UCu8PPJ8s8-WGL0BBliB4duQ","showPreferences":false,"subscribedButtonText":{"runs":[{"text":"SUBSCRIBED"}]},"unsubscribedButtonText":{"runs":[{"text":"SUBSCRIBE"}]},"trackingParams":"CFMQmysiEwjklJj0wd3wAhVmxRYJHbXkAVUyDGl2LWVuZHNjcmVlbg==","unsubscribeButtonText":{"runs":[{"text":"UNSUBSCRIBE"}]},"serviceEndpoints":[{"clickTrackingParams":"CFMQmysiEwjklJj0wd3wAhVmxRYJHbXkAVUyDGl2LWVuZHNjcmVlbg==","commandMetadata":{"webCommandMetadata":{"sendPost":true,"apiUrl":"/youtubei/v1/subscription/subscribe"}},"subscribeEndpoint":{"channelIds":["UCu8PPJ8s8-WGL0BBliB4duQ"],"params":"EgIIBBgA"}},{"clickTrackingParams":"CFMQmysiEwjklJj0wd3wAhVmxRYJHbXkAVU=","commandMetadata":{"webCommandMetadata":{"sendPost":true}},"signalServiceEndpoint":{"signal":"CLIENT_SIGNAL","actions":[{"clickTra
